import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';

// Composants de layout (Navbar et Footer)
import Navbar from './components/Navbar';
import Footer from './components/footer';

// Pages publiques
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';

// Protection des routes
import PrivateRoute from './auth/PrivateRoute';

// Dashboards
import { AdminLayoutWrapper, DashboardHome } from './pages/AdminDashboard';
import { PatientLayoutWrapper, DashboardHome as PatientDashboardHome } from './pages/PatientDashboard';
import { MedecinLayoutWrapper, DashboardHome as MedecinDashboardHome } from './pages/MedecinDashboard';
import PatientDashboard from './dashboards/PatientDashboard';
import MedecinDashboard from './dashboards/MedecinDashboard';

// Pages Admin
import Patients from './pages/admin/Patients';
import Medecins from './pages/admin/Medecins';
import Services from './pages/admin/Services';
import Rdv from './pages/admin/Rdv';
import Finances from './pages/admin/Finances';
import Moderateurs from './pages/admin/Moderateurs';

// Pages Patient
import MesRendezVous from './pages/patient/MesRendezVous';
import MonDossier from './pages/patient/MonDossier';
import MesOrdonnances from './pages/patient/MesOrdonnances';
import MesConsultations from './pages/patient/MesConsultations';

// Pages Medecin
import MesPatients from './pages/medecin/MesPatients';
import MesConsultationsMedecin from './pages/medecin/MesConsultations';
import CreerDossier from './pages/medecin/CreerDossier';
import MesRendezVousMedecin from './pages/medecin/MesRendezVous';
import MesDossiers from './pages/medecin/MesDossiers';

// Composant principal de l'application
// Structure : Navbar → Routes → Footer
function App() {
  return (
    <div className="min-h-screen flex flex-col">
      {/* ✅ NAVBAR GLOBALE - Visible sur toutes les pages sauf login/register/admin */}
      <Navbar />

      {/* Contenu principal avec routes */}
      <main className="flex-grow">
        <Routes>
          {/* Routes publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Routes Patient - Toutes protégées avec PatientLayout */}
          <Route 
            path="/patient" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <PatientDashboardHome user={null} />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/patient/rendez-vous" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <MesRendezVous />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/patient/dossier" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <MonDossier />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/patient/ordonnances" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <MesOrdonnances />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/patient/consultations" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <MesConsultations />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />

          {/* Dashboard Patient (ancien - redirection vers /patient) */}
          <Route 
            path="/dashboard" 
            element={
              <PrivateRoute allowedRoles={['Patient']}>
                <PatientLayoutWrapper>
                  <PatientDashboardHome user={null} />
                </PatientLayoutWrapper>
              </PrivateRoute>
            } 
          />

          {/* Dashboard Médecin */}
          <Route 
            path="/medecin" 
            element={
              <PrivateRoute allowedRoles={['Medecin']}>
                <MedecinDashboard />
              </PrivateRoute>
            } 
          />

          {/* Routes Admin - Toutes protégées avec AdminLayout */}
          <Route 
            path="/admin" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <DashboardHome 
                    stats={{ totalPatients: 1247, totalMedecins: 89, totalRdv: 456, revenue: 2450000 }}
                    recentActivity={[
                      { id: 1, action: 'Nouveau patient inscrit', user: 'Mamadou Diop', time: '2min' },
                      { id: 2, action: 'Médecin ajouté', user: 'Dr. Awa Ndiaye', time: '15min' },
                      { id: 3, action: 'RDV confirmé', user: 'Service Pédiatrie', time: '1h' }
                    ]}
                  />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/patients" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Patients />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/medecins" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Medecins />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/rdv" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Rdv />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/services" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Services />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/finances" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Finances />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />
          <Route 
            path="/admin/moderateurs" 
            element={
              <PrivateRoute allowedRoles={['Admin']}>
                <AdminLayoutWrapper>
                  <Moderateurs />
                </AdminLayoutWrapper>
              </PrivateRoute>
            } 
          />

          {/* Route 404 - Redirection vers l'accueil */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>

      {/* ✅ FOOTER GLOBAL - Visible sur toutes les pages sauf admin */}
      <Footer />
    </div>
  );
}

export default App;
